import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import reportWebVitals from "./reportWebVitals";
import "tachyons"; //dependecia que permite poner estilos como por ej "bg-light-green"
import { robots } from "./robots";
import Card from "./Card";

ReactDOM.render(
  <div>
    <Card id={robots[0].id} nombre={robots[0].nombre} email={robots[0].email} />
    ,
    <Card id={robots[1].id} nombre={robots[1].nombre} email={robots[1].email} />
    ,
    <Card id={robots[2].id} nombre={robots[2].nombre} email={robots[2].email} />
    ,
  </div>,
  document.getElementById("root")
);

// If you want to start measuring performance in your app, pass a function
